import axios from 'axios';

const BOARD_API_BASE_URL = "http://localhost:8080/api"

class service {
    getBoards() {
        console.log(axios.get(BOARD_API_BASE_URL));
        return axios.get(BOARD_API_BASE_URL);
    }
}
export default new service();
